import React from 'react';
import ProductCard from './ProductCard';
import '../assets/BuyAgo.css';
import { Link } from 'react-router-dom';

const BuyAgo = ({ onProductClick, toggleFavorite, isFavorite }) => {
  const products = [
    {
      id: 8,
      image: require('../assets/photo/vetchina.png'),
      price: '77,99',
      title: 'Комбайн КЗС-1218 «ДЕСНА-ПОЛЕСЬЕ GS12»',
      rating: 2,
      category: 'Еда',
    },
    {
      id: 6,
      image: require('../assets/photo/sausages.png'),
      price: '159,99',
      title: 'Комбайн КЗС-1218 «ДЕСНА-ПОЛЕСЬЕ GS12»',
      rating: 2,
      category: 'Еда',
    },
    {
      id: 5,
      image: require('../assets/photo/colbasa1.png'),
      price: '599,99',
      title: 'Комбайн КЗС-1218 «ДЕСНА-ПОЛЕСЬЕ GS12»',
      rating: 2,
      category: 'Еда',
    },
    {
      id: 7,
      image: require('../assets/photo/milk1.webp'),
      price: '49,39',
      title: 'Комбайн КЗС-1218 «ДЕСНА-ПОЛЕСЬЕ GS12»',
      rating: 2,
      category: 'Еда',
    },
  ];

  return (
    <div className="buyago-section">
      <div className="section-header">
        <h2>Покупали раньше</h2>
        <Link to="/buyago" className="all-buyago">Все покупки</Link>
      </div>

      { }
      <div className="buyago-container">
        <div className="cards-container">
          {products.map((product, index) => (
            <ProductCard
              key={index}
              image={product.image}
              price={product.price}
              title={product.title}
              rating={product.rating}
              onAddToCart={() => onProductClick?.(product)}
              onToggleFavorite={() => toggleFavorite(product)}
              isFavorite={isFavorite(product)}
            />
          ))}
        </div>
      </div>
    </div>
  );
};

export default BuyAgo;
